import React from "react";
import Cards from "./Cards";
import "./App.css";
import Sdata from "./Sdata";

console.log(Sdata[0].title);

function App() {
  return (
    <>
      <h1 className="heading">List of Top 5 Netflix series</h1>
      <Cards
        imgsrc={(Sdata[0], imgsrc)}
        title="A Netflix Original Series"
        sname="Dark"
        link="https://www.netflix.com/in/title/80990668?source=35"
      />
      <Cards
        imgsrc="https://i.pinimg.com/564x/2e/b6/9e/2eb69e110dca05dd800e48e72027a92e.jpg"
        title="A Netflix Original Series"
        sname="Extra curricular"
        link="https://www.netflix.com/in/title/80990668?source=35"
      />
      <Cards
        imgsrc="https://wallpapercave.com/wp/wp1917154.jpg"
        title="A Netflix Original Series"
        sname="Stranger Things"
        link="https://www.netflix.com/in/title/80990668?source=35"
      />
    </>
  );
}

export default App;
